import { Paper, Grid, Box } from "@material-ui/core";

function Postx({ pey, refy, onPostsItemload, post, itemheight }: any) {
  return (
    <>
      <div key={pey} className="pics">
        <img
          onLoad={(e: any) => {
            onPostsItemload(e, pey);
          }}
          ref={refy}
          className="turlightxx"
          src={`./images/posts/${post.item1}`}
          alt="a superstarz post "
          style={{
            marginTop: pey === 0 ? "0px" : "-30vh",
            width: "100%",
            height: itemheight[pey],
            position: "relative",
            zIndex: pey + pey,
            display: "block",
            padding: "0px",
            objectFit: "contain",
          }}
        />
        <div
          className="error-background-darkxx it"
          style={{ zIndex: pey + pey + pey }}
        >
          {" "}
        </div>
      </div>
    </>
  );
}

export const Post = React.memo(Postx);
